import React from 'react';
import ISidebar from '../../interfaces/ISidebar';

interface Props {
  sidebar: ISidebar;
}

const Sidebar = ({ sidebar: { title, logoPath, mainLinks, sideLinks, footerItems } }: Props) => {
  const renderLinks = (links: {id: number, name: string, url?: string}[]): React.ReactNode => {
    return (
      links.map((l): React.ReactNode => {
        return (
          <div key={l.id}>
            <a href={l.url}>{l.name}</a>
          </div>
        )
      })
    )
  }
  return (
    <>
      <div>
        <img className="" src={logoPath} alt="logo" />
        <div>{title}</div>
        <div className='sidebar-main'>
          {renderLinks(mainLinks)}
        </div>
        <div className='sidebar-side'>
          {renderLinks(sideLinks)}
        </div>
        <div className='sidebar-footer-items'>
          {renderLinks(footerItems)}
        </div>
        <div className='sidebar-footer'>

        </div>
      </div>
    </>
  )
}

export default Sidebar;
